import { baseURL } from "./OpenAI";
import { useEffect, useState } from "react";
import axios from "axios";

function GetPetNames(props)  {
    const petNames = [];
    const urlBase= baseURL;
    console.log(this.urlBase+"nlp-pet-name/specie/"+props.specie);
    useEffect(() => {
        axios
            .post(this.urlBase+"nlp-pet-name/specie/"+props.specie)
            .then(res => {
                this.petNames = res.data;
                this.specie = props.specie;
            })
            .catch(err => {
                console.log(err);
            });
    }, []);
}

export {GetPetNames}
